import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Route,
    Link
  } from "react-router-dom";

export default class Users extends Component {
    render(){
    return (
    <div>
        <div class="parallax-container targetTopo">
            <div class="parallax corPadrao">
                <div class="container">
                        {/* <Link to="/app">
                            <i class="material-icons left medium white-text">chevron_left</i>
                        </Link> */}
                    <h2 style={{ color: '#fff' }}>Usuários</h2>
                </div>
            </div>
        </div>
        <div class="container">
            <div class="row">
                <form class="col s12">
                    <div class="card-panel" style={{ marginTop: '-40px', borderRadius: '22px' }}>
                    Usuários
                    </div>
                </form>
            </div>
        </div>
    </div>
    )
}

}
